$(function() {
	var ieVer = getIEVer();

	if (ieVer != null&&parseInt(ieVer) < 9) {
		document.write("<div style='width:80%;margin:0 auto;color:#C90000;text-align:center;'>" + "<h1>请升级IE到8以上或换用谷歌火狐以获得更好的体验</h1>" + "<h1 >~~(X____X)~~~</h1></div>");
		return;
	};


	// skrollr.init({
	// 	forceHeight: false,
	// 	smoothScrolling: true
	// });
	$("#demos").sliphover();

	//initiallize grid layout for tags
	var container = document.querySelector('#tagsContainer');
	var pckry = new Packery(container, {
		itemSelector: '.tag',
		gutter: 10
	});
	eventie.bind(container, 'click', function(event) {
		// don't proceed if item was not clicked on
		var target = event.target;
		if (!classie.has(target, 'tag')) {
			return;
		}

		var isGigante = classie.has(target, 'bigTag');
		classie.toggleClass(target, 'bigTag');

		if (isGigante) {
			// if shrinking, just layout
			pckry.layout();
		} else {
			// if expanding, fit it
			pckry.fit(target);
		}
	});
	$(".tagContent").on('click', function() {
		$(this).parent().trigger('click');
	})


	//load text keroppi into about section
	loadTextKeroppi();
	//background color change trick
	$(".color-cube").on("click", function() {
		$('body').css('background-color', $(this).css('background-color'));
	})
	$("#color-pick").on("change", function() {
		$('body').css('background-color', $(this).val());
	})

	//play the console trick
	if (navigator.userAgent.indexOf('Chrome') > -1) {

		$("#color-pick").show();

		$("#imageCollection").append('<small>少年，你居然点了这个标签，赶紧去console看一下发生了什么吧</small>');

		//consoleTrick() //************************unrealve this after publish
		consoleTrick();
	};

	$("#techbtn").click(function(){
		var techWin=window.open("","tech within this site");
		techWin.document.write($("#techInfo").html());
	})

})

